const searchUrl = `https://api.unsplash.com/search/photos/`;

function App() {
	const handleChange = (e) => {};
	return (
		<main className="search">
			<form className="search-form">
				<input
					type="text"
					className="form-input"
					placeholder="search"
					onChange={(e) => e.target.value}
				/>
				<button className="submit-btn">
					<FaSearch />
				</button>
			</form>
		</main>
	);
}

export default App;
